import { delToken } from '../store';
import { useAppContext } from '../store';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Button from 'react-bootstrap/Button';
import { Link } from 'react-router-dom';

const NavCustom = () => {
    const {store, dispatch} = useAppContext();

    return (
        <Navbar bg="info" expand="lg" variant="dark">
        <Navbar.Brand href="/">
            엄마들을 위한 공간
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <NavDropdown title="일자리 등록" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">시터 찾아요</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.1">시터 할래요</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="#link">Link</Nav.Link>
            <NavDropdown title="안심인증" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
        {store.isAuthenticated ? (
            <Link
                className="mr-sm-2"
                to="/accounts/signout"
                onClick={(e) => {
                    e.preventDefault();
                    dispatch(delToken());
                }}
            >
                <Button variant="danger">로그아웃</Button>
            </Link>
        ) : (
            <Link
                className="mr-sm-2"
                to="/accounts/signin"
            >
                <Button variant="danger">로그인</Button>
            </Link>

        )}  

      </Navbar>
    );
};

export default NavCustom;
